import NavbarOption from "../NavbarOption/NavbarOption";
import { HashRouter as Router, Routes, Route } from 'react-router-dom';
import { Enlace1 } from "../../Pages/Enlace1";
import { Enlace2 } from "../../Pages/Enlace2";

const NavbarInfo = {
    link: "link4.html",
    name: "Enlace 4"
}

export default function Navbar() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/Enlace 1" element={Enlace1}/>
                    <Route path="/" element={Enlace2}/>
                </Routes>
            </Router>

            <h1>Barra de navegación</h1>

            <ul>
                <NavbarOption link={"link1.html"} name={"Enlace 1"}/>
                <NavbarOption link={"link2.html"} name={"Enlace 2"}/>
                <NavbarOption link={"link3.html"} name={"Enlace 3"}/>
                {/* También se puede con un objeto usando el spread operator (...) */}
                <NavbarOption {...NavbarInfo}/>
            </ul>
        </>

    );
}
